import React from 'react';
import { NavLink } from 'react-router-dom';
import './navbar.css';

function Navbar() {
  const handleScroll = (id) => {
    const section = document.getElementById(id);
    if (section) {
      section.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <nav>
      <ul>
        <li>
          <NavLink to="/" exact activeClassName="active" onClick={() => handleScroll('home')}>Home</NavLink>
        </li>
        <li>
          <NavLink to="/about" activeClassName="active" onClick={() => handleScroll('about')}>About</NavLink>
        </li>
        <li>
          <NavLink to="/education" activeClassName="active" onClick={() => handleScroll('education')}>Education</NavLink>
        </li>
        <li>
          <NavLink to="/project" activeClassName="active" onClick={() => handleScroll('project')}>Projects</NavLink>
        </li>
        <li>
          <NavLink to="/connect" activeClassName="active" onClick={() => handleScroll('connect')}>Connect</NavLink>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
